    if (!origData) return;
    const radarData = [];
    const indexList = Object.keys(origData[0])
    indexList.forEach((key) => {
      const dataArray = origData.map(d => d[key])
      const item = {
        name: key,
        min: d3.min(dataArray),
        max: d3.max(dataArray),
        mean: d3.mean(dataArray),
      }
