      .call(g => g.append("text")
          .attr("dy","0.35em")
          .attr("x", d => d3.pointRadial(x(d), radius*outerRadius + axisLabelDistance)[0]) 
          .attr("y", (d,i) => d3.pointRadial(x(d), radius*outerRadius + axisLabelDistance)[1])
          .attr("fill", "white")
